import { Card } from "antd";

const Login = () => {
  return (
    <div className="bg-[#F9ECCE] w-[100%] h-[100vh] ">
      <div className="p-[100px] text-center !justify-center ">
        <Card style={{ width: "50%" }} className="!text-center">
          <p>Card content</p>
          <p>Card content</p>
          <p>Card content</p>
        </Card>
      </div>
    </div>
  );
};
export default Login;
